function ExpenseDate (props) {
    const month = props.numInfo.toLocaleString('en-US', { month: 'long' })
    const year = props.numInfo.getFullYear()
    const day = props.numInfo.toLocaleString('en-US', { day: '2-digit' })
    return(
        <div>
            <div>{month}</div>
            <div>{year}</div>
            <div>{day}</div>
        </div>
    )
}

export default ExpenseDate
